import React from "react";
import Card from "./Card"
import "./index.css"
import SeriesData from "./SeriesData"



function App() {

    return (
        <>
            <h1 className="heading_style">List Of Top 9 Netflix Series</h1>
            {SeriesData.map(function netflixCard(val) {
                return (
                    <Card
                        imgsrc={val.imgsrc}
                        title={val.title}
                        sname={val.sname}
                        links={val.links}
                         />
                )
            })}
        </>
    )
}


export default App
